// App.js
import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

import photoJames from "./photo_james.jpg";
import IntroductionSection from "./components/IntroductionSection";
import SkillsSection from "./components/SkillsSection";
import ResumeProjectsSection from "./components/ResumeProjectsSection";

function App() {
  return (
    <div className="App">
      <div className="text-center my-4">
        <img
          src={photoJames}
          alt="James"
          style={{
            width: "200px",
            height: "200px",
            objectFit: "cover",
            borderRadius: "50%",
          }}
        />
      </div>

      <IntroductionSection />
      <SkillsSection />
      <ResumeProjectsSection />

      {/* Footer with GitHub & LinkedIn icons */}
      <footer className="text-center mt-5 pb-4">
        <a
          href="https://github.com/YourGitHubUser"
          target="_blank"
          rel="noopener noreferrer"
          className="mx-3"
        >
          <i className="bi bi-github" style={{ fontSize: "2rem" }}></i>
        </a>
        <a
          href="https://www.linkedin.com/in/YourLinkedInUser"
          target="_blank"
          rel="noopener noreferrer"
          className="mx-3"
        >
          <i className="bi bi-linkedin" style={{ fontSize: "2rem", color: "#0e76a8" }}></i>
        </a>
      </footer>
    </div>
  );
}

export default App;
